function injectExternalJS(e){var t=document.getElementsByTagName("head")[0];for(var n=0;n<arguments.length;n++){var r=document.createElement("script");r.setAttribute("type","text/javascript");r.setAttribute("src",arguments[n]);t.appendChild(r)}}function injectExternalCss(e){var t=document.getElementsByTagName("head")[0];for(var n=0;n<arguments.length;n++){var r=document.createElement("link");r.setAttribute("type","text/css");r.setAttribute("rel","stylesheet");r.setAttribute("href",arguments[n]);t.appendChild(r)}}
